			<p>إشتقت ليك جواك أكيد حنين لبيتك الموجود جوايا
<br/>أنا حبيتك جيت و فديتك قاعد بعيد مستني إيه
<br/>إرجعلي تاني من عالم فاني هينتهي فتح عينيك أنا مستنيك في رجوعك عيد دا مكانك هنا تسكن في غنى مش كالعبيد</p>
